import React from 'react';
import { Box } from '@mui/material';

const HeroVideo = () => {
  return (
    <Box sx={{ width: '100%', height: '100%', overflow: 'hidden', position: 'relative' }}>
      <video
        autoPlay
        loop
        muted
        playsInline
        style={{
          position: 'absolute',
          width: '100%',
          height: '100%',
          objectFit: 'cover',
        }}
      >
        <source src="https://drive.google.com/file/d/1J8FMuuNqnrNKUdFAUxWhgA3BEngJtpjE/view?usp=sharing" type="video/mp4" />
        Your browser does not support the video tag.
      </video>
    </Box>
  );
};

export default HeroVideo;
